import React from "react";
import "./LinkIcons.css";
import { FaFacebookF, FaLinkedinIn ,FaSteam} from "react-icons/fa";



class LinkIcons extends React.Component {
  render() {
    return (

      <div>
        <div className="linkContainer">

          <ul className="link-list">
            <a href= "https://www.facebook.com/CyberDyneACEVESPA.CSUS" target="_blank">
              <nobr className="facebook-link" >
                <FaFacebookF/>
              </nobr> 
            </a>
            <a href="https://steamcommunity.com/groups/CyberAceCC" target="_blank">
              <nobr className="linkedin-link"><FaLinkedinIn/></nobr>  
            </a>
            <a href ="https://steamcommunity.com/groups/CyberAceCC" target="_blank"> 
              <nobr className="steam-link"><FaSteam/></nobr>  
            </a>

          </ul> 
        </div>

      </div>

    )
  }
}
export default LinkIcons;
